import React, { Component } from 'react';

import './nav.scss';
import { render } from 'react-dom';

class Nav extends Component {
	constructor(props) {
		super(props);
		this.state = {
			nav: true,
		};
	}

	recipe(e) {
		e.preventDefault();
		alert('Recipe Search');
	}
	calc(e) {
		e.preventDefault();
		alert('Calculator App');
	}
	todo(e) {
		e.preventDefault();
		alert('Todo List');
	}
	shop(e) {
		e.preventDefault();
		alert('Shopping List');
	}
	home(e) {
		e.preventDefault();
		alert('Home Page');
	}
	render() {
		return (
			<div className='nav'>
				<i onClick={recipe} className='fas fa-utensils fa-2x'></i>
				<i onClick={calc} className='fas fa-calculator fa-2x'></i>
				<i onClick={todo} className='fas fa-list fa-2x'></i>
				<i onClick={shop} className='fas fa-shopping-cart fa-2x'></i>
				<i onClick={home} className='fas fa-home fa-4x'></i>
			</div>
		);
	}
}

export default Nav;
